import {Injectable} from '@angular/core';
import {FaceSnap} from '../models/face-snap';
import {SnapType} from '../models/snap-type.type';

@Injectable({
  providedIn: 'root' // On enregistre ce service à la racine de l'application pour avoir une instance unique
})
export class FaceSnapsService {
  private faceSnaps: FaceSnap[] = [
    new FaceSnap("Montre", "Élégance et précision réunies. Cette montre au design moderne s’adapte à toutes vos tenues, qu’elles soient casual ou chic. Son bracelet confortable et son cadran raffiné en font un accessoire incontournable pour sublimer votre style au quotidien;",175, new Date(), 0,"data:image/jpeg;base64,",3),
    new FaceSnap("Collier", "Apportez une touche de sophistication à votre tenue avec ce collier délicat. Ses finitions soignées et son pendentif élégant captent la lumière pour illuminer votre décolleté. Parfait pour toutes les occasions, du quotidien aux soirées spéciales.",90, new Date(), 10,"data:image/jpeg;base64,",5),
    new FaceSnap("Bague", "Ces boucles d’oreilles allient finesse et glamour. Légères et raffinées, elles apportent éclat et élégance à votre visage. À porter seules pour un style discret ou en duo avec d’autres accessoires pour un look audacieux.",64, new Date(), 100,"data:image/jpeg;base64,",2.5),
    new FaceSnap("Boucle-d'oreille", "Sublimez votre allure avec cette couronne majestueuse. Chaque détail est travaillé avec soin pour offrir un éclat royal, parfait pour les cérémonies, mariages ou événements prestigieux. Une pièce qui fera de vous la reine de la soirée.",175, new Date(), 45,"data:image/jpeg;base64,",1),
    new FaceSnap("Parrure", "Exprimez votre style avec cette bague unique. Son design moderne et ses finitions élégantes en font un bijou incontournable pour sublimer vos mains. À porter seule pour un look minimaliste ou associée à d’autres bagues pour un style affirmé.",175, new Date(), 20,"data:image/jpeg;base64,",4),
    new FaceSnap("Couronne", "Harmonie parfaite entre collier, boucles et bague. Cette parure raffinée illumine votre tenue grâce à des détails sophistiqués et un design élégant. Idéale pour les grandes occasions ou pour offrir un cadeau mémorable.",175, new Date(), 3,"data:image/jpeg;base64,",2),
  ];

  // new FaceSnap("Montre", "premierComposant",175, new Date(), 0,"url",3),
  //     new FaceSnap("Collier", "2emeComposant",90, new Date(), 10,"url",5),
  //     new FaceSnap("Bague", "3emeComposant",64, new Date(), 100,"url",2.5),


  getSnapFaces(): FaceSnap[] {
    return [...this.faceSnaps] // Pour retourner un tableau indépendant meme si il à les mêmes références
  }

  // Utilisation du service pour certaines méthodes :

  getSnapById(id: string): FaceSnap {
    const trouverSnap = this.faceSnaps.find(FaceSnap => FaceSnap.id === id );
    if (!trouverSnap) {
      throw new Error("No snap snap found with ID " + id);
    }else{
      return trouverSnap;
    }
  }

  snapFaceById(faceSnapId: string, snapType: SnapType) {
      const trouverSnap = this.getSnapById(faceSnapId);
      trouverSnap.snap(snapType);
    }
}
